import { Container } from 'reactstrap';
import './App.css';

function App() {
  return (
    <Container>
      <div class="jumbotron pt-5">
        <h1 class="display-4 d-flex justify-content-center">Welcome...</h1>
        <div class="row">
          <div class="col"></div>
          <div class="col"><p class="lead justify-content-center">My name is Scott Steinmetz and this is my website.</p></div>
          <div class="col"></div>
        </div>
        <hr class="my-3 hr-color"/>
        <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
      </div>
    </Container>
  );
}

export default App;
